  [],\n\t\"revision_timestamp\": \"2016-07-27T22:57:30.514427\",\n\t\"name\": \"2005-annual-narrative-report-seney-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Seney
  NWR, Huron NWR, Whitefish Point NWR, Kirtlandu2019s Warbler NWR, Harbor Island NWR,
  Michigan Islands NWR outlines activities and accomplishments during the 2005 calendar
  year. The report begins with an introduction to the Refuge. Highlights and weather
  conditions are summarized for the year. Information about monitoring and studies-
  including surveys and censuses and studies and investigations- is provided next.
  Habitat restoration and management projects are also covered; activities include
  wetland restoration, upland restoration, riverine restoration, water level management,
  grazing/mowing/haying, forest management, fire management, and vegetation control.
  Fish and wildlife management are discussed next with emphasis on bird banding, reintroductions,
  and nest structures. Coordination activities, such as interagency coordination and
  private land activities, are outlined. The resource protection section provides
  an update on law enforcement, contaminants, and cultural resource management. Information
  about public education and recreation is given including visitor services and outreach.
  Finally, general administration is discussed in the Refuge planning and administration
  section.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
